import './addStockCss.css';
function AddStock() {
    return (
        <>
            <div className='container'>
                <div className='row'>
                    <div className='col-12'>
                        <h1 id='addDE'>Modify your Stock!</h1>
                    </div>
                </div>
                <div className='row'>
                    <div className='col-12'>
                        <form>
                                <label>Hello: </label>
                                <input type='text' />
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
}

export default AddStock;
